import React from 'react'
import { Fragment } from 'react/cjs/react.production.min'
import Filter from '../Filter'
import HeaderMenu from '../HeaderMenu'

export default function AnimeFilter() {
  return (
    <Fragment>
        <HeaderMenu></HeaderMenu>
        <Filter></Filter>
    </Fragment>
  )
}
